import React, { Component } from 'react';
import Sidebar from './components/Sidebar.js'
import Editor from './components/Editor.js'


class App extends Component {
  render(){
    return(
      <div className="App">
        <Sidebar class="column column-25"/>
        <Editor class="column column-75"/>
      </div>
    )
  }
}

export default App;
